q($,"aFB","aeB",()=>A.dg("Wakaf Pembangunan","assets/img/pembinaan/lahan.jpeg","**JUMAT BERKAH SAATNYA BERWAKAF**\n\nHari jumat adalah hari raya bagi seorang muslim dalam sepekan dari hari-hari biasanya. Mari ambil momentum rayakan hari jumat dan raih keberkahan tiada akhir dengan berwakaf!\n\nTunaikan wakaf terbaikmu mulai 100 Ribu Rupiah ! **Ikut Partisipasi Wakaf Pembangunan Pondok Tahfidz Yatim & Dhuafa Al Mukarromah, Cianjur**\n\nhttps://youtu.be/KRswZr858kw\n\n\n\ud83d\udcb3 BSI (ex-BSM) 7148434306\n\n\ud83d\udc64 a.n Yayasan Berkah Yatim Indonesia\n\nKode bank: 451\n \n\ud83d\udcf1Konfirmasi Wakaf:\nhttps://wa.me/6281912002001\n\n","/wakaf-pembangunan",1e5))
