q($,"aFE","aiu",()=>A.dg("Zakat Profesi","assets/img/pembinaan/profesi.jpeg","Zakat penghasilan ini dikeluarkan setiap kali memperoleh penghasilan, nishobnya 85gr emas/tahun, jika harga emas murni saat ini Rp 800.000 maka nishob zakat per bulan 5,7 juta. Adapun besaran zakatnya adalah 2.5% dari penghasilan","/zakat-profesi",null))
