q($,"aFx","aqb",()=>A.dg("Buka Bersama Yatim & Dhu'afa","assets/img/pembinaan/yatimTajil.jpeg","Pada saat bulan Ramadhan banyak orang yang berlomba-lomba dalam kebaikan. Salah satu kegiatan yang umum adalah dengan mengadakan buka puasa bersama 300 anak yatim @Rp 10.000;/paket. Meskipun tampak sederhana, nyatanya kegiatan ini memiliki banyak manfaat. ","/tajil-yatim",1e4))
